import React, { Component } from 'react';

class Pokecard extends Component {
  render() {
    const { id, name, type, experience } = this.props;

    return (
      <div className="poke-card">
        <h2 key={id}>Name: {name} </h2>
        <p>Type: {type}</p>
        <p>Experience: {experience}</p>
      </div>
    );
  }
}

export default Pokecard;
